	add("abracadabra", "{\"term\":\"abracadabra\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027abracadabra\u0027 a word used in magical writings, of uncertain origin. Relationships have been suggested with \u0027\u0027 (a Gnostic deity), and with various Aramaic or Hebrew terms (\u0027עַבְדָא כְּדַברָא\u0027 \u0027avda kedavara\u0027; “what was said has been done”; \u0027עבראכדברא\u0027 \u0027avra kedavra\u0027; “what has said has come to pass”; \u0027ארבע-אחד-ארבע\u0027 when it is read from right to left [http://www.scribd.com/doc/14656725/Abracadabra]), but there is little supporting evidence.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A use of the mystical term ‘abracadabra’, supposed to work as part of a healing charm or a magical spell; any spell or incantation making use of the word\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Georgina Turner, \u0027The Guardian\u0027, 28 Aug 2012\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"With a quiet bank holiday afternoon to fill, the Mill yesterday dug out the old magic kit, brushed the cobwebs off its top hat and practiced a few \u0027\u0027abracadabras\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Mumbo-jumbo; obscure language or technicalities; jargon\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I don’t know all the theoretical \u0027\u0027abracadabra\u0027\u0027 about how it works, I’m only its pilot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, \u0027Religion and the Decline of Magic\u0027, Folio Society 2012, p. 335\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Astrology was not specifically banned in the statutes against witchcraft, but so long as its technicalities remained \u0027\u0027abracadabra\u0027\u0027 to the lay public there was always a risk that the practitioner might find himself arrested for sorcery\", \"priority\":7}]}, \"synonyms\":{}}");

