	add("abraham", "{\"term\":\"abraham\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Hebrew\"], \"text\":\"From {{m|la|Ābraham}}, from Ancient greek (to 1453) \u0027ἀβραάμ\u0027 from Hebrew \u0027אַבְרָהָם|lang\u003dhe\u0027 (tr\u003davrahám) Glossed as \u0027אַב|lang\u003dhe\u0027 (tr\u003dav) + \u0027הֲמוֹן|lang\u003dhe\u0027 (tr\u003dhamón) in s:he:t0117|Genesis 17:4–5; or from Hebrew \u0027אַבְרָם|lang\u003dhe\u0027 (tr\u003davrám)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A prophet in the Old Testament, Qur\u0027an and Aqdas; a Semitic patriarch who preached monotheism, father of the Jewish patriarch Isaac and the Arab patriarch Ishmael. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1611\u0027\u0027, \u0027s:Bible (King Genesis 17:5\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Neither shall thy name any more be called Abram, but they name shall be \u0027\u0027Abraham\u0027\u0027; for a father of many nations have I made thee\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, Werner Keller, \u0027The Bible as History\u0027 (tr. by William Neil), chapter 7, page 93\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As one would expect of caravan people around 1900 B.C., the caravan people depicted in the Khnum-hotpe grave had donkeys, whereas the Bible says that \u0027\u0027Abraham\u0027\u0027 and his people, who according to the traditional interpretation are supposed to have lived at the same period, already possessed camels\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"lt;ref name\u003dSOED/\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027, \u0027Mother Night\u0027, Dell (1975), page 28\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"quot;Lincoln wasn\u0027t a Jew, was he?\u0026quot; he said. \u0026quot;I\u0027m sure not,\u0026quot; I said. - - - \u0026quot;The name \u0027\u0027Abraham\u0027\u0027 is very suspicious, to say the least,\u0026quot; said Goebbels. \u0026quot;I\u0027m sure his parents didn\u0027t realize that it was a Jewish name,\u0026quot; I said. \u0026quot;They must have just liked the sound of it. They were simple frontier people. If they\u0027d known the name was Jewish, I\u0027m sure they would have called him something more American, like George or Stanley or Fred.\u0026quot\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"lt;ref name\u003dSOED/\u0026gt\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The 14th sura (chapter) of the Quran\", \"priority\":10}]}, \"synonyms\":{}}");

