	add("abrasion", "{\"term\":\"abrasion\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"First attested in 1656. From French \u0027abrasion\u0027 (attested since 1611), from \u0027abrasio\u0027 (a scraping) from {{m|la|abrādō||scrape off}}. See also \u0027abrad. Etymology|abrade\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of abrading, wearing, or rubbing off; the wearing away by friction. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The substance thus rubbed off; debris. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The effect of mechanical erosion of rock, especially a river bed, by rock fragments scratching and scraping it. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An abraded, scraped, or worn area. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A superficial wound caused by scraping; an area of skin where the cells on the surface have been scraped or worn away. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The wearing away of the surface of the tooth by chewing\", \"priority\":6}]}, \"synonyms\":{}}");

