	add("abreaction", "{\"term\":\"abreaction\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"German\", \"English\"], \"text\":\"Partial translation of German \u0027abreagierung\u0027 from \u0027ab\u0027 (away from) + \u0027reagierung\u0027 (reaction) \u0026lt;ref name\u003dWI3\u0026gt;{{R:MW3 1976|page\u003d5}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The re-living of an experience with a view to purging its emotional dross. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

